brates the music of Django Reinhardt and Stephane Grappelli's pioneering Quintette du Hot Club de France. The HCSF borrows the instrumentation of violin, bass, and guitars from the original Hot Club while breathing new life into the music with innovative arrangements of classic tunes and original compositions from the group's superb lead guitarist, Paul Mehling. Featuring the silken violin of twice GRAMMY® Award-winning Evan Price, the velvet vocals of Isabelle Fontaine, and a swinging rhythm section, the group never fails to surprise and delight.

The Hot Club of San Francisco Goes Fab! The Venerable Gypsy Swing Combo Interprets the Beatles on the Gorgeous New Album John, Paul, George and Django...

It was only a matter of time before guitarist Paul Mehling focused his creative mojo on Lennon and McCartney’s vast and enduring treasure trove of songs. The founder and guiding spirit of the Hot Club of San Francisco, America’s longest running Gypsy swing ensemble, Mehling was first inspired to pick up a guitar when the Beatles launched the British Invasion via Ed Sullivan’s CBS variety show on Feb. 9, 1964. Now Mehling’s HCSF is recolonizing the Fab Four’s songbook in the name of Gypsy jazz legend Django Reinhardt with John, Paul, George and Django, a ravishing and consistently revelatory reimagining of classic Beatles tunes. Slated for release on Mehling’s Hot Club label in September, 2016, the band’s 14th album is designed both to seduce Beatlephiles and enchant Djangologists, with arrangements that serve the songs rather than turning them into vehicles for blazing solos.","isMobileFriendly":"true","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atjmbo.jpg","width":960,"height":641},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atlg.jpg","width":300,"height":200},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atmd.jpg","width":200,"height":134},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-og.jpg","width":2048,"height":1367},"small":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atsm.jpg","width":100,"height":67},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/02/18/16/19-sqsm.jpg","width":60,"height":60},"xlarge":{"p